import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonItem, IonLabel, IonButton } from '@ionic/react';
import {useState} from 'react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab2.css';

const Tab2: React.FC = () => {
  const [lat, setLat] = useState('N/A')  
  const saveCoordinates = () => {
    setLat('stuff2')
  }

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Iniciar Captura de Coordenadas</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Coordenadas</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonItem>
          <IonLabel>Latitud</IonLabel>          
          <IonLabel>{lat}</IonLabel>
        </IonItem>
        <IonItem>
          <IonLabel>Longitud</IonLabel>          
          <IonLabel>N/A</IonLabel>
        </IonItem>
        <IonItem>
          <IonLabel>Timestamp</IonLabel>          
          <IonLabel>N/A</IonLabel>
        </IonItem>
        <IonItem>
          <IonButton expand="block" color="primary" onClick={ () => saveCoordinates() } >Guardar GPS</IonButton>
        </IonItem>
      </IonContent>
    </IonPage>
  );
};

export default Tab2;
